%% 随机矩阵
%{

% 首先，我们生成一个100*100的随机整数矩阵，元素取值范围为0-1
map = randi([0, 1], 100, 100);

% 然后，我们遍历这个矩阵，将其中的元素按照一定规则进行修改，以模拟出真实地图中的障碍物分布情况
for i = 2:size(map, 1)
    for j = 2:size(map, 2)
        % 如果当前位置的上方、左方或左上方存在障碍物，则将当前位置设为障碍物
        if map(i-1, j) == 1 || map(i, j-1) == 1 || map(i-1, j-1) == 1
            map(i, j) = 1;
        end
    end
end

% 最后，我们需要确保图中不存在死胡同，也就是说，任意两个相邻的位置都不能是障碍物
for i = 2:size(map, 1)
    for j = 2:size(map, 2)
        % 如果当前位置和其上方、左方或左上方都是障碍物，则将其设为可通行区域
        if map(i-1, j) == 1 && map(i, j-1) == 1 && map(i-1, j-1) == 1
            map(i, j) = 0;
        end
    end
end

%}

